def decorate(func, ):
    def wrapper(*args, **kwargs):
        print(f'******** {func} **********************')
        for a in args:
            print(f'******** func args {a}  *****************\n')
        return func(*args, **kwargs)

    return wrapper


debug = True


def log(*args, sleep: int = 0):
    if debug:
        for a in args:
            print(f'***** {a} *****')
    time.sleep(sleep)


